import React from 'react';
import Button from './components/Button'; 
import { FaBeer } from 'react-icons/fa'; 

const App: React.FC = () => {
  return (
    <div style={{ padding: '20px' }}>
      <Button
        label="Klik untuk berobat umum"
        icon={FaBeer}
        iconPosition="left"
        size="medium"
        tooltip="Ini adalah tooltip"
        tooltipPosition="top"
        onClick={() => alert('Anda memilih poli umum')}
      />
      <Button
        label="Klik untuk berobat dengan keluhan khusus"
        icon={FaBeer}
        iconPosition="right"
        size="large"
        tooltip="Tooltip di bawah"
        tooltipPosition="bottom"
        onClick={() => alert('Anda memilih poli khusus')}
      />
    </div>
  );
};

export default App;
